import React, { useState, useRef, useCallback } from "react";
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';

type Props = {
};

const RoomSlide: React.FunctionComponent<Props> = ({
}) => {
    const handleOnDragStart = (e: { preventDefault: () => any; }) => e.preventDefault()
    return (
        <AliceCarousel mouseTrackingEnabled>
            <img src="http://blogfiles.naver.net/MjAyMDAxMDlfMjY1/MDAxNTc4NTQxMTkyNTgx.hwK2Tr5pR58uZ1E88Qmssu5f43WDBkNULmMuHliJh5og.3bBZ5Ea2hfxi0LEdkkPW3ychqnBB-J2CUcDZVCcrNEQg.JPEG.todayis_soo/%C4%AB%C4%AB%BF%C0%C7%C1%B7%BB%C1%EE_%B6%F3%C0%CC%BE%F0_%B0%A1%BD%C0%B1%E2_%283%29.jpg" onDragStart={handleOnDragStart} className="yours-custom-class" />
            <img src="http://blogfiles.naver.net/MjAyMDAxMDlfMjY1/MDAxNTc4NTQxMTkyNTgx.hwK2Tr5pR58uZ1E88Qmssu5f43WDBkNULmMuHliJh5og.3bBZ5Ea2hfxi0LEdkkPW3ychqnBB-J2CUcDZVCcrNEQg.JPEG.todayis_soo/%C4%AB%C4%AB%BF%C0%C7%C1%B7%BB%C1%EE_%B6%F3%C0%CC%BE%F0_%B0%A1%BD%C0%B1%E2_%283%29.jpg" onDragStart={handleOnDragStart} className="yours-custom-class" />
            <img src="http://blogfiles.naver.net/MjAyMDAxMDlfMjY1/MDAxNTc4NTQxMTkyNTgx.hwK2Tr5pR58uZ1E88Qmssu5f43WDBkNULmMuHliJh5og.3bBZ5Ea2hfxi0LEdkkPW3ychqnBB-J2CUcDZVCcrNEQg.JPEG.todayis_soo/%C4%AB%C4%AB%BF%C0%C7%C1%B7%BB%C1%EE_%B6%F3%C0%CC%BE%F0_%B0%A1%BD%C0%B1%E2_%283%29.jpg" onDragStart={handleOnDragStart} className="yours-custom-class" />
            <img src="http://blogfiles.naver.net/MjAyMDAxMDlfMjY1/MDAxNTc4NTQxMTkyNTgx.hwK2Tr5pR58uZ1E88Qmssu5f43WDBkNULmMuHliJh5og.3bBZ5Ea2hfxi0LEdkkPW3ychqnBB-J2CUcDZVCcrNEQg.JPEG.todayis_soo/%C4%AB%C4%AB%BF%C0%C7%C1%B7%BB%C1%EE_%B6%F3%C0%CC%BE%F0_%B0%A1%BD%C0%B1%E2_%283%29.jpg" onDragStart={handleOnDragStart} className="yours-custom-class" />
            <img src="http://blogfiles.naver.net/MjAyMDAxMDlfMjY1/MDAxNTc4NTQxMTkyNTgx.hwK2Tr5pR58uZ1E88Qmssu5f43WDBkNULmMuHliJh5og.3bBZ5Ea2hfxi0LEdkkPW3ychqnBB-J2CUcDZVCcrNEQg.JPEG.todayis_soo/%C4%AB%C4%AB%BF%C0%C7%C1%B7%BB%C1%EE_%B6%F3%C0%CC%BE%F0_%B0%A1%BD%C0%B1%E2_%283%29.jpg" onDragStart={handleOnDragStart} className="yours-custom-class" />
        </AliceCarousel>
    );
}

export default RoomSlide;
